import { Container } from 'react-bootstrap';

export default function SignupSuccess({
   first,
   last,
   username,
   password,
   street,
   city,
   state,
   zip,
   email,
   phone,
}) {
   return (
      <>
         <Container fluid align="center">
            <div style={{ width: '25%', textAlign: 'left' }}>
               <h1>You have successfully signed up!</h1>
               <p>{`Welcome back, ${first}!`}</p>
            </div>
         </Container>
      </>
   );
}
